import "./Header.css";
const Header = () => {
  return (
    <div className="header">
      <div className="headerTitles">
        <span className="headerTitlesSm">React & Node</span>
        <span className="headerTitlesLg">Blog</span>
      </div>
      <img className="headerImg"src="https://images.pexels.com/photos/5428833/pexels-photo-5428833.jpeg?cs=srgb&dl=pexels-olya-kobruseva-5428833.jpg&fm=jpg" alt="blogImg">
      </img>
    </div>
  );
};
export default Header;
